import $ from "jquery";

function getAllServicesById(id) {
  const retorno = $.ajax({
    type: "get",
    contentType: "application/json;charset=UTF-8",
    async: false,
    url: "http://localhost:8080/Servicos/Categoria?categoria=" + id
  })
    .done(function(msg) {
      return JSON.stringify(msg.responseJSON);
    })

    .fail(function(jqXHR, textStatus, msg) {
      console.log(jqXHR);
      console.log(textStatus);
      console.log(msg);
    });

  return retorno;
}

export default getAllServicesById;
